import React from 'react'
import PaginatedItems from './PaginatedItems';


function Posts({posts,loading}) {
    if(loading){
        return <h2>Loading...</h2>
    } 
    return (
        <>          
            <PaginatedItems itemsPerPage={2} posts={posts}/>      
        </>

    )
}

export default Posts
